import Leaflet from 'react-leaflet'
import React, { StrictMode } from 'react'
import OSMap from './OSMap.js'
import Search from './components/search.js'
import './App.css';


function App() {
  return (
    <div className="App">
      <OSMap>
        <Search/>
      </OSMap>
    </div>
  );
}

export default App;
